CREATE DEFINER=`root`@`%` PROCEDURE `spwalletdetailid`(
	IN tokentrans varchar(254),
    IN walletprocess tinyint(4)
)
BEGIN
	SELECT 
		`tempwallet`.`tempwalletindex`,
		`tempwallet`.`tempwalletlabel`,
		`tempwallet`.`tempwalletlabeltimestamp`,
		`tempwallet`.`tempwalletaccountRS`,
		`tempwallet`.`tempwalletpublicKey`,
		`tempwallet`.`tempwalletaccount`,
		`tempwallet`.`tempwalletlastedittimestamp`,
		`tempwallet`.`tempwalletcreatetimestamp`,
		`tempwallet`.`tempwalletinserttimestamp`,
		`tempwallet`.`tempwalletcolor`,
		`tempwallet`.`tempwalletprocess`
	FROM
		`tempwallet`
	WHERE
		tempwallettokentrans = tokentrans
		AND tempwalletprocess = walletprocess
		AND TIMESTAMPDIFF(MINUTE,
		tempwalletinserttimestamp,
		NOW()) <= 60;
END ;;
