CREATE DEFINER=`root`@`localhost` PROCEDURE `spxxxauthlogininfo`(
IN `platform` VARCHAR(20), 
IN `userindex` VARCHAR(15)
)
BEGIN
	
	IF platform = 'ANDROID' OR platform = 'IOS' THEN
		SELECT 
			tableuserindex,
			tableusername,
			tableuserfullname,
			tableuserinitial,
			tableuserapptoken tokenlogin,
			tableuserreferralcode,
			tableuseremail,
			tableuser2fatype,
			tableuserphonecountrycode,
			tableuserphonenumbershort,
			tableuserphonenumber,
			tableuserphonenumberisverified,
			tableuserlanguage,
			tableusercolorback,
			tableusercolorfront
		FROM
			xxxtableuser
		WHERE
			tableuserindex = userindex;
	ELSE
		
		SELECT 
			tableuserindex,
			tableusername,
			tableuserfullname,
			tableuserinitial,
			tableuserwebtoken tokenlogin,
			tableuserreferralcode,
			tableuseremail,
			tableuser2fatype,
			tableuserphonecountrycode,
			tableuserphonenumbershort,
			tableuserphonenumber,
			tableuserphonenumberisverified,
			tableuserlanguage,
			tableusercolorback,
			tableusercolorfront
		FROM
			xxxtableuser
		WHERE
			tableuserindex = userindex;
	END IF;
END ;;
